        {props.cabeceras.map((cabecera) => (
          <th>{cabecera}</th>
        ))}
      </tr>
    </thead>
    <tbody>
      {props.prospectos.map((prospecto) => {
        return (
          <tr>
            {() => {
              for (var datos in prospecto) {
                console.log(prospecto);
              }
            }}
          </tr>
        );
      })}
    </tbody>
  </table>
);

